import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "./styles.css"

const Home = () => {
  const token = localStorage.getItem('token');
  console.log(token);

  // Estado para almacenar la lista de usuarios
  const [users, setUsers] = useState([]);
  const [reports, setReports] = useState([]);

  // Función para obtener los usuarios desde el API
  const fetchUsers = async () => {
    try {
      const response = await axios.get(
        'https://ujed-api.onrender.com/api/users?order_by=created_at&order=desc&limit=5',
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setUsers(response.data);
    } catch (error) {
      console.error('Error al obtener usuarios:', error);
    }
  };

  const fetchReports = async () => {
    try {
      const response = await axios.get(
        'https://ujed-api.onrender.com/api/reports?limit=10&offset=0&order=asc',
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setReports(response.data);
    } catch (error) {
      console.error('Error al obtener reportes:', error);
    }
  };

  // Llamamos a fetchUsers y fetchReports al cargar el componente
  useEffect(() => {
    fetchUsers();
    fetchReports();
  }, []); // La lista de depend

  // Llamamos a fetchUsers al cargar el componente

  return (
    <div className="dashboard-container">
    <h1 className='title'>Dashboard</h1>
    <div className="user-list">
      <h2 className='title'>Lista de Usuarios</h2>
      <div className="table-container">
      <table>
          <thead className='title-t'>
            <tr className='header'>
              <th>ID</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Email</th>
              <th>Roles</th>
              <th>Creado</th>
              <th>Actualizado</th>
            </tr>
          </thead>
          <tbody className='body'>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td>{user.name}</td>
                <td>{user.last_name}</td>
                <td>{user.email}</td>
                <td>{user.roles.join(', ')}</td>
                <td>{new Date(user.created_at).toLocaleString()}</td>
                <td>{new Date(user.updated_at).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
    <div className="report-list">
      <h2 className='title' >Lista de Reportes</h2>
     <div className="table-container">
     <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Título</th>
            <th>Descripción</th>
            <th>Estado</th>
            <th>Ubicación</th>
            <th>Usuario</th>
            <th>Imágenes</th>
            <th>Creado</th>
            <th>Actualizado</th>
          </tr>
        </thead>
        <tbody>
          {reports.map(report => (
            <tr key={report.id}>
              <td>{report.id}</td>
              <td>{report.title}</td>
              <td>{report.description}</td>
              <td>{report.status}</td>
              <td>{report.location}</td>
              <td>{report.user.name}</td>
              <td>
                  {/* Mostrar solo la primera imagen del reporte */}
                  {report.images.length > 0 && (
                    <img src={report.images[0].url} alt="Reporte" style={{ maxWidth: '100px', maxHeight: '100px' }} />
                  )}
                </td>
              <td>{new Date(report.created_at).toLocaleString()}</td>
              <td>{new Date(report.updated_at).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
     </div>
    </div>
  </div>
);
};

export default Home;
